import React, { useState }from 'react';
import { FiEye, FiEyeOff } from 'react-icons/fi';


import Header from '../../Main/components/Header';
import '../styles/ClinicLogin.css';
import eyeClick from '../eyeClick';

function ClinicLogin(){
    const [showPassword, setShowPassword] = useState(false);

  const handleShowPassword = () => {
    setShowPassword(!showPassword);
  };
    return(
        <div>
        < Header />
       <div className="login_clinic">
        <div className="login_form">
            <span className='login_title'>Entre na conta da sua Clínica:</span>
            <form>
            <div className="input_container">
                <label htmlFor="email">E-mail</label>
                <input type="text" name='email' id='email' placeholder='Digite seu e-mail'/>
            </div>
            <div className="input_container">
                <div className="pass_forgot">
                <label className='pass' htmlFor="password">Senha</label>
               <a href="">Esqueceu?</a>
                </div>
                <input type={showPassword ? 'text' : 'password'} />
      <button onClick={handleShowPassword}>
        {showPassword ? <FiEyeOff /> : <FiEye />}
      </button>
            </div>
        </form>
       <button className="button_login_clinic">
        Entrar
       </button>
       <div className="register">
        <span>Ainda não tem uma conta? <a href="/registerClinic">Cadastre-se</a></span>
       </div>
        </div>     
       </div>
       </div>
    );
};

export default ClinicLogin;
